import React from 'react';
import './Styles.css';

function ToS() {
  return (
    <div className="mainSpace">
      <center>
        <h1>Terms of Service</h1>
        <p>
          Terms of Service ("Terms") Our Terms of Service were last updated on
          April 16, 2022. Please read these terms and conditions carefully
          before using Our Service. The words of which the initial letter is
          capitalized have meanings defined under the following conditions. The
          following definitions shall have the same meaning regardless of
          whether they appear in singular or in plural.
        </p>
      </center>
    </div>
  );
}

export default ToS;
